import React, { useState } from 'react';
import { Button, Rating, TextField } from '@mui/material'
import './Product.css'
import { useNavigate } from 'react-router-dom';
import axios from 'axios'

const Product = () => {

    const [input,setInput] = useState({
        rating:''
    })

    const navigate = useNavigate();

    const addHandler = (e) => {
        const {name,value}=e.target
        setInput((input) => ({...input,[name]:value}))
        console.log(input)
        }

        const clickHandler =() =>{
            console.log("Clicked")
            console.log(input)
            axios.post("http://localhost:3005/new",input)
            .then((response) =>{
            alert("Record Saved")
            navigate('/Analytics');
            })
            .catch(err=>console.log(err))
            }

    return (
        <div align="center" className='txt'>
       <h3>Restaurant Rating</h3><br/><br/>
       <TextField  label="Restuarant id" name='restuarant' variant="outlined" type='text'/><br/><br/>
       Rating Approved by Govt&nbsp;&nbsp;<Rating name="size-small" defaultValue={3} size='small' onChange={addHandler} /><br/><br/>
       <Button align="center" variant='contained' onClick={clickHandler}>Submit</Button>

    </div>
    );
};

export default Product;
